import React from 'react';

export default class Weather extends React.Component{
      render(){
            return(
                  <div className="weather">
                        <label>Temperature:</label> <span>{this.props.state.temperature}</span>
                        <label>Humidity:</label> <span>{this.props.state.humidity}</span>
                        <label>City:</label> <span>{this.props.state.city}</span>
                        <label>Country:</label> <span>{this.props.state.country}</span>
                        <label>Description:</label> <span>{this.props.state.description}</span>

                  </div>
            )
      }
}
